import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';

const Rolled = () => {
  return (
    <Container>
      <Row>
        <Col>
          <h1 class="" >Rolled</h1>
        </Col>
      </Row>
    </Container>
  );
}

export default Rolled;
